import React from 'react';
import { Chart } from "react-google-charts";



function MyChart(props) {
    console.log(props.ar)

    const data = props.ar;
   const options = {
    title: 'Compaction Test Result of Ferro Manganese Slag',
      hAxis: {
        title: (props.ar[0][0]+" (%)"),
      },
      vAxis: {
        title: "Density (g/cm3)",
      },
      series: {

        0: { curveType: "function" },
        1: { curveType: "function" },
        2: { curveType: "function" },
      },
    };



    return (
      <>

      <Chart
        chartType="LineChart"
        width="100%"
        height="600px"
        data={data}
        options={options}
      />







      </>)
}

export default MyChart;
